INSERT INTO `tbl_eac_decision` VALUES (1,2173,12,'EAC/CM30/Decision 93','1899-12-31 00:00:00',NULL,'The Council reiterated its previous decision directing the Secretariat and Partner States to adhere to the EAC Rules of Procedure for convening and postponement of meetings','','continuous','Level of adherence','CTC/Partner States',30,NULL,NULL,NULL,'2016-11-01 15:38:16',1,'2016-11-01 12:38:17',NULL),(2,2285,12,'EAC/CM31/Directive 23','1899-12-31 00:00:00',NULL,'The Council directed  that the Partner State(s) that will not attend the Sectoral Council Meetings should give a seven (7) days’ notice in event that they are unable to participate in the Meeting','','Continuous','Level of compliance','Partner States',31,NULL,NULL,NULL,'2016-11-01 15:39:16',1,'2016-11-01 12:39:16',NULL),(3,2286,12,'EAC/CM31/Directive 24','1899-12-31 00:00:00',NULL,'The Council directed  that in event that a 7 days’ notice is not given and Partner States are already at the venue of the meeting, the meeting should proceed with deliberations and the outcome of the meeting and decision reached shall bind the absent Partner State.','','Continuous','Level of adherence','CTC/SG/Partner States',31,NULL,NULL,NULL,'2016-11-01 15:39:16',1,'2016-11-01 12:39:16',NULL),(4,2345,12,'EAC/CM 32/Directive 32','1899-12-31 00:00:00',NULL,'The Council  directed Partner States to expedite the process of nominating members to the ad hoc EAC Service Commission to deal with recruitment issues of the EAC.','','No timeframe given','List of members nominated by each Partner State','Partner States',32,NULL,NULL,NULL,'2016-11-01 15:39:34',1,'2016-11-01 12:39:34',NULL),(5,2346,12,'EAC/CM 32/Directive 33','1899-12-31 00:00:00',NULL,'The Council directed the Partner States to constitute an ad hoc committee to address the issues of recruitment in the EAC and refer the matter to the Sectoral Council on EAC Affairs and Planning.','','Sectoral Council on EAC Affairs and Planning','List  of memebers  that  constitute the ad hoc committee','Partner States',32,NULL,NULL,NULL,'2016-11-01 15:39:34',1,'2016-11-01 12:39:34',NULL),(6,2370,12,'EAC/CM33/ Directive 01','1899-12-31 00:00:00',NULL,'The Council directed Partner States and EAC Organs and Institutions  to implement all the outstanding  decisions and directives and report progress to the 34th Meeting of the Council','','34th Meeting of the Council','Number of outstanding decisions and directives implemented and reported','Partner States /Organs and Institutions',33,NULL,NULL,NULL,'2016-11-01 15:40:03',1,'2016-11-01 12:40:03',NULL),(7,2371,12,'EAC/CM33/ Directive 01','1899-12-31 00:00:00',NULL,'The Council directed Partner States and EAC Organs and Institutions  to implement all the outstanding  decisions and directives and report progress to the 34th Meeting of the Council','','34th Meeting of the Council','Number of outstanding decisions and directives implemented and reported','Partner States /Organs and Institutions',33,NULL,NULL,NULL,'2016-11-01 15:40:03',1,'2016-11-01 12:40:03',NULL),(8,2372,12,'EAC/CM33/ Directive 02','1899-12-31 00:00:00',NULL,'The Council  directed the Secretariat and Partner States to undertake an analysis of the decisions/directives that are still under implementation for a long period of time and report back to the 34th Meeting of the Council','','34th Meeting of the Council','Analysis undertaken and report presented','SMEO/Partner States',33,NULL,NULL,NULL,'2016-11-01 15:40:03',1,'2016-11-01 12:40:03',NULL),(9,2376,12,'EAC/CM33/\nDirective 01','2016-02-29 00:00:00',NULL,'The Council directed Partner States and EAC Organs and Institutions  to implement all the outstanding  decisions and directives and report progress to the 34th Meeting of the Council','','34th Meeting of the Council','Number of outstanding decisions and directives implemented and reported','Partner States /Organs and Institutions',33,NULL,NULL,NULL,'2016-11-01 15:40:03',1,'2016-11-01 12:40:03',NULL),(10,2377,12,'EAC/CM33/ Directive 02','1899-12-3