INSERT INTO `tbl_page` VALUES (1,'East African Integration Monitoring System(EAMS)','<p style=\"text-align: center;\">\r\n	The EAMS-TANZANIA system belongs to the Ministry of Foreign Affairs and East African Cooperation&nbsp; for monitoring the implementation of the Summit and Council Decisions; the Common Market Protocol; and the 4th EAC Development Strateg</p>\r\n<p>\r\n	<strong>Core Features </strong></p>\r\n<ul>\r\n	<li>\r\n		EAC integration decisions and directives updates and progress.</li>\r\n	<li>\r\n		Ministry&rsquo;s Strategic Plan tracking of progress of outputs.</li>\r\n	<li>\r\n		EAC outcomes for Tanzania based on selected outcome indicators</li>\r\n</ul>\r\n','home_page');
